there-exists-test(node: class benchmark-node)

r1, r2, r3: truth-value;

begin
  r1 = (there exists a grt-minimum-scan-interval-block MSI connected to B);
  r2 = (there exists a grt-minimum-scan-interval-block MSI connected to B such that (the name of MSI is GRT-A));
  r3 = (there exists a grt-alternative MA connected to B);
  if (r1 = true and r2 = true and r3 = false) then
    begin call pass(node);
    end
  else
    begin call fail(node, "there exists test results is wrong.");
    end
end

list-connections (OBJ: class my-object) = ( sequence ) 
N: integer;
C: class connection;
// indeed structures are more appropriate, but we have no 
// "structures are identicial", we have only grtl-sequences-are-identical
res : sequence;
begin
    res = sequence();
  N = 0;
  for C = each connection connected at the input of OBJ do
    N = N + 1;
  end;
  res = insert-at-end(res,"For Each Connection");
  res = insert-at-end(res,N);
  
  N = 0;
  for C = each red-con connected at the input of OBJ do
    N = N + 1;
  end;
  res = insert-at-end(res,"For Each Red-Con");
  res = insert-at-end(res,N);
 
  N = 0;
  for C = each blue-con connected at the input of OBJ do
    N = N + 1;
  end;
  res = insert-at-end(res,"For Each Blue-Con");
  res = insert-at-end(res,N);
 
  res = insert-at-end(res,"Count Connection");
  res = insert-at-end(res,the count of each connection connected at the input of OBJ);
  res = insert-at-end(res,"Count Red Con");
  res = insert-at-end(res,the count of each red-con connected at the input of OBJ);
  res = insert-at-end(res,"Count Blue Con");
  res = insert-at-end(res,the count of each blue-con connected at the input of OBJ);
  res = insert-at-end(res,"One Red Con Exists");
  res = insert-at-end(res,(if the red-con connected at the input of OBJ exists then true else false));
  res = insert-at-end(res,"One Blue Con Exists");
  res = insert-at-end(res,(if the blue-con connected at the input of OBJ exists then true else false));
  
  post "[res]";
  return res;
end

gensymcid-581-test(node: class benchmark-node)
status : truth-value;
status-text : text;
begin
    status,status-text = call gensymcid-581-test-inner();
    if status then 
        call fail(node,status-text)
    else
        call pass(node);
end

gensymcid-581-test-inner() = (truth-value, text)
status : truth-value;
status-text : text;
expected-sequence : sequence = sequence ("For Each Connection", 2,
  "For Each Red-Con",  1,
  "For Each Blue-Con",  1,
  "Count Connection",  2,
  "Count Red Con",  1,
  "Count Blue Con",  1,
  "One Red Con Exists",  true,
  "One Blue Con Exists",  true);
actual-sequence : sequence;
begin 
actual-sequence = call list-connections( my-obj1 ); 
if not (expected-sequence = actual-sequence) then
    return true, "For my-obj1, expected [expected-sequence], but got [actual-sequence]";
actual-sequence = call list-connections( my-obj2 ); 
if not (expected-sequence = actual-sequence) then
    return true, "For my-obj2, expected [expected-sequence], but got [actual-sequence]";
actual-sequence = call list-connections( my-obj3 ); 
if not (expected-sequence = actual-sequence) then
    return true, "For my-obj3, expected [expected-sequence], but got [actual-sequence]";
return false,"";
end

test-123 ()

n: integer = 100000;

ts, te: quantity;
Result: truth-value;
i: integer;

begin

    ts = the current subsecond real time;

    for i = 1 to n do
        Result = (there exists a grt-minimum-scan-interval-block MSI connected to B);
    end;

    te = the current subsecond real time;

    post "[n] time @"if there exists . . . connected to@" [te - ts as an interval]";


    ts = the current subsecond real time;

    for i = 1 to n do
        Result = (the workspace of B exists);
    end;

    te = the current subsecond real time;

    post "[n] time @" the workspace of B exists @" [te - ts as an interval]"; 


    ts = the current subsecond real time;

    for i = 1 to n do
        Result = (the connections-ok of B);
    end;

    te = the current subsecond real time;

    post "[n] time @" the connections-ok of B @" [te - ts as an interval]"; 


    ts = the current subsecond real time;

    for i = 1 to n do
        change the status icon-color of B to the value of true-colour;
        change the status icon-color of B to the value of no-colour; 
    end;

    te = the current subsecond real time;

    post "[n] time @" change the status icon-color of B to . . . @" [te - ts as an interval]"; 

end
